script: |
  super -f text -I q7908.spq | sort > q7908.out

inputs:
  - name: q7908.spq
    data: |
      SELECT ALL + + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE - ( - col1 ) - + col2 NOT IN ( + + 91 * - 21 * 87, + 92 );
  - name: tab0

outputs:
  - name: q7908.out
    data: |
      10
      47
      99
